import { Button, ButtonToolbarProps } from 'react-bootstrap';

type ButtonProps = {
  text: string;
  link: string;
};

const ButtonComponent: React.FC<ButtonProps> = ({ text, link }) => {
  const buttonStyle = {
    border: '1px solid white',
    backgroundColor: 'transparent',
    color: 'white',
  };

  return (
    <Button
      href={link}
      variant="primary"
      size="sm"
      className="d-flex align-items-center justify-content-center text-uppercase"
      style={buttonStyle}
    >
      {text}
    </Button>
  );
};

export default ButtonComponent;
